import React from "react";
import "./App.css";
import NavigationBar from "./components/NavigationBar";
import Feed from "./components/Feed";
import { Container, Row, Col } from "react-bootstrap";

function App() {
  const marginTop = {
    marginTop: "20px"
  };

  return (
    <div className="App">
      <NavigationBar />
      <Container>
        <Row>
          <Col lg={12} style={marginTop}>
            <Feed />
          </Col>
        </Row>
      </Container>
      <p>Hello World</p>
    </div>
  );
}

export default App;
